(1, 1, 'New location in Louisville, KY', 'Fast I Repair opened at Oxmoor Center on 9/1/2013', '<p>The very first Fast I&nbsp;Repair location in the state of Kentucky. We are located inside Oxmoor Center</p>\r\n<p>which is one of the premier shopping destination in Louisville, KY.&nbsp;</p>\r\n<p>Our address is</p>\r\n<p>Fast I&nbsp;Repair</p>\r\n<p>7900 Shelbyville Road</p>\r\n<p>Louisville, Kentucky 40222</p>\r\n<p>Come by and see us today.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2013-09-11 04:07:29', 2),
(18, 1, 'New Hours of Operation', 'New Hours of Operation', '<p>Please check our new hours of operation as they have change. Remember to bring Socks.&nbsp;</p>', '2014-04-05 21:18:52', 1),
(19, 1, 'Happy Easter!!!', 'Easter 2014', '<p><span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px;">Tomorrow April 20th, we will be open from 11:30 am until 5:00 pm to give our employees time to celebrate Easter Holiday, thank you for your support and Happy Easter!!!</span></p>', '2014-04-19 22:49:16', 1),
