 Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]-->  <!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\ntable.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:Calibri;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]-->    <!--StartFragment-->\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">WONDER PARTIES<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">Wonderland Playground offers the perfect environment for fun while not having to be worried about the setting up and cleaning, just come and let us help you plan the perfect party for your kid(s), so you can have all the fun with your family and friends.<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">Come and check our party packages, they include everything you need to make your party and event to remember.<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">Party Packages include:<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Private party room for 2 full hours.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Invitations for your guests.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Gift for the Birthday child.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Dedicated party pro.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Drink for each child.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">A slice of cheese pizza for each child.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">A bag of Popcorn for each child.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Paper plates, cups, tablecloth and utensils.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpLast" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Courtesy set up and cleaning.<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">Party Extras:<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent:-.25in;mso-list:l1 level1 lfo2"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Additional food.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l1 level1 lfo2"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Additional drinks.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l1 level1 lfo2"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Additional decorations and themes.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l1 level1 lfo2"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Ice cream.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l1 level1 lfo2"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Goodie Bags.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpLast" style="text-indent:-.25in;mso-list:l1 level1 lfo2"><!--[if !supportLists]--><span style="font-size:14.0pt;line-height:107%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol">&middot;<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:14.0pt;line-height:107%;\r\nfont-family:Tabitha">Come and ask us for more extras&hellip;..<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size:14.0pt;line-height:107%;font-family:\r\nTabitha">We allow you to bring your own cake or we can get one for you with your reserved party, but any other outside food or drink are not allowed. &nbsp;<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-family: Calibri, sans-serif; font-size: 14pt; line-height: 107%;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style="font-size: 10pt; line-height: 107%;">&nbsp;</span></p>\r\n<!--EndFragment-->', '2013-11-29 16:07:53', 3);
