ocked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]-->  <!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\ntable.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:Calibri;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]-->    <!--StartFragment-->\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">1.- For how long can I play?&nbsp;<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">Admission is valid to play during business hours on the day the admission was issue, although once you leave the premises there is no re-entry.<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">2.- Is there an age restriction?<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">Yes, WONDERLAND PLAYGROUND is designed for kids from 6 months old till 10 years old, older kids are welcome to enter but not play.<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">3.- What does Wonderland Playground does to ensure the safety for kids?<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">In Wonderland Playground we believe Safety is first, that&rsquo;s why we have the following rules in set in our playground:<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpFirst" style="margin-left:135.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:12.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:12.0pt;line-height:107%">Identifying bracelets.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:135.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:12.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:12.0pt;line-height:107%">Video monitoring throughout Wonderland Playground.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:135.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:12.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:12.0pt;line-height:107%">Properly trained staff.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:135.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:12.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:12.0pt;line-height:107%">Certified Inflatables.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:135.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:12.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:12.0pt;line-height:107%">Safety rubber flooring throughout the entire playground areas.<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left:135.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:12.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:12.0pt;line-height:107%">Safety mats at the entrance and exits of inflatables. <o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">4.- Can we bring outside food or drinks to Wonderland Playground?<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">No, we don&rsquo;t allow outside food or drinks in WONDERLAND PLAYGROUND, except for dietary reasons and infant food. We provide a great variety of food and we have vending machines for a quick snack or ice cream.<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">5.- Do you offer discount prices for groups?<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">Yes, we have several different packages for groups and large parties. Please contact us for more information.<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">6.- Are socks needed to play at WONDERLAND PLAYGROUND?<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">Yes, for hygiene reasons and in appreciation to other patrons we do require that everyone going into the playground areas wear sock (kids and parents alike), if you forget to bring your socks we do have them available in most sizes.<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">7.- How can I book a party at WONDERLAND PLAYGROUND?<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">It&rsquo;s easy just click on the link BOOK A PARTY and party host will contact you, or you can call us at 407-5327496.<o:p></o:p></span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:107%">8.- Can we order food in advance for our kids/group?<o:p></o:p></span></p>\r\n<p><span style="font-size:12.0pt;line-height:107%;font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Yes, just call us in advance and we&rsquo;ll take of it so you can have it ready at your desire time.</span><!--EndFragment--></p>', '2013-11-29 16:12:10', 3);
