(12, 1, 'Walk-in Parties (Max. 08 Kids)', 'Walk-in Parties ', '<p class="MsoNormal"><span style="font-size:20.0pt;line-height:107%">Walk-in Parties (Max. 08 Kids)<o:p></o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size:22.0pt;line-height:107%">Sometimes you didn&rsquo;t have time to plan ahead, you just don&rsquo;t have the amount of people required for a birthday package or simply want to celebrate a special occasion, we have designed walk-in parties&rsquo; packages available for your convenience, they must be pre-paid on the day of the party in order to have a reserved table. The package includes:<o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:22.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:22.0pt;line-height:107%">04 Admissions. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span style="font-size:22.0pt;line-height:107%;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-hansi-font-family:Calibri;mso-bidi-font-family:\r\nCalibri">-<span style="font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size:22.0pt;line-height:107%">A Drink for the kids.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nb